import React from "react";

const menuItem = () => {
    return (
        <nav className={'menuItem'}>
            <div>Profile</div>
            <div>Message</div>
            <div>News</div>
            <div>Music</div>
            <div>Setting</div>
        </nav>
    )
};

export default menuItem();
